import { createApp } from 'vue'; // Importe createApp em vez de Vue
import App from './App.vue';
import router from './router';

createApp(App).use(router).mount('#app'); // Use o método createApp para criar a aplicação Vue

new Vue({
    router,
    render: h => h(App),
}).$mount('#app');
